import React from 'react';
import NavBar from "./NavBar";
import './App.css';

function App() {
    return (
        <div className="App">
            <NavBar />
            <div className="App-header">
                <p>This is a learning page</p>
                <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                >
                    Learn React
                </a>
            </div>
        </div>
    );
}

export default App;
